async function getIcon(name) {
  return {path: KB_ICONS_MAP[name]?.path};
}
async function getIconList() {
  return Object.entries(KB_ICONS_MAP).map(([icon, content]) => ({
    name: icon,
    keywords: content.keywords,
  }));
}

